script: |
  super -f text -I q5448.spq | sort > q5448.out

inputs:
  - name: q5448.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) WHERE col1 * + col1 + - + 92 NOT IN ( - - col0, - 16 * - col1, col0 / ( 88 ) );
  - name: tab2

outputs:
  - name: q5448.out
    data: |
      46	51	23
      64	77	40
      75	67	58
